var model;

var Enumerable = require("linq");

model = module.exports.model = [
    { id: 1, title: "Image 1", content: "data:image/png;base64," },    
    { id: 2, title: "Image 2", content: "data:image/png;base64," },    
    { id: 3, title: "Image 3", content: "data:image/png;base64," },    
    { id: 4, title: "Image 4", content: "data:image/png;base64," },    
    { id: 5, title: "Image 5", content: "data:image/png;base64," },    
    { id: 6, title: "Image 6", content: "data:image/png;base64," },    
    { id: 7, title: "Image 7", content: "data:image/png;base64," },    
];


module.exports.allDrawings = function(done) {
  process.nextTick(function() {
    done(null, model);
  });
}

module.exports.getPaint = function(id, done) {
  process.nextTick(returnPaint);


  function returnPaint() 
  {
    var paint = Enumerable.From(model).SingleOrDefault(null, function(p) {
      return p.id == id;
    });

    done(null, paint);
  }

}

